       "    'title': \"Opinion | 'Don't Panic' Is Rotten Advice\",\n",
       "    'body': 'This coronavirus is new to our species -- it is \"novel.\" It spreads more easily than the flu -- \"exponentially,\" as we now say -- and is estimated to be at least 10 times as lethal.\\n\\nTesting in the U.S. has been wholly inadequate; history may come to see this as the great scandal of the epidemic. \"Anybody that needs a test gets a test; they\\'re there, they have the tests, and the tests are beautiful,\" as the president said last weekend, is on a par with \"If you like your doctor you can keep your doctor\" as a great, clueless lie. ...',\n",
