       "    'url': 'https://www.wsj.com/articles/what-we-can-learn-from-the-20th-centurys-deadliest-pandemic-11583510468',\n",
       "    'title': \"What We Can Learn From the 20th Century's Deadliest Pandemic\",\n",
       "    'body': 'In 1918, the Spanish flu killed more than 50 million people around the world. The lessons of that outbreak could save countless lives in the fight against the coronavirus.\\n\\nThe \"Spanish\" flu of 1918 was one of the deadliest pandemics in human history. Seeming to come from nowhere in the waning days of World War I, it spread through a war-ravaged world like wildfire. In a matter of months, a third of the world\\'s population was infected, 50 to 100 million people died, and the global economy shrank by 5%.\\n\\nThe world of 1918 was very different from today\\'s, where the new coronavirus is emerging as another potential pandemic. A century ago, antibiotics, modern hospitals, intensive care units and instant...',\n",
