       "    'url': 'https://www.wsj.com/articles/canadian-prime-minister-justin-trudeaus-wife-tests-positive-for-coronavirus-11584066591',\n",
       "    'title': \"Canadian Prime Minister Justin Trudeau's Wife Tests Positive for Coronavirus \",\n",
       "    'body': 'Sophie Grégoire Trudeau was tested after having flulike symptoms; prime minister plans to be in isolation for 14 days By Kim Mackrael Kim Mackrael The Wall Street Journal BiographyKim Mackrael @kimmackrael kim.mackrael@wsj.com Updated March 12, 2020 10:43 pm ET\\n\\nOTTAWA -- Canadian Prime Minister Justin Trudeau on Thursday said he would isolate himself for a 14-day period after his wife, Sophie Grégoire Trudeau, tested positive for the new coronavirus.\\n\\nA statement from Mr. Trudeau\\'s office, issued late Thursday, said the prime minister is in good health and wouldn\\'t be tested for the virus at this stage because he hasn\\'t experienced symptoms. Doctors said there is no risk to those who have had recent contact with Mr. Trudeau because he hasn\\'t had symptoms, the prime minister\\'s office said.\\n\\n\"The Prime Minister will continue to fully assume his duties and will address Canadians tomorrow,\" the statement said.\\n\\nMs. Grégoire Trudeau was tested for the new coronavirus after she began having mild flulike symptoms including a low fever late Wednesday night. Ms. Grégoire Trudeau\\'s symptoms remain mild and she is feeling well, the prime minister\\'s office said. She had recently returned from a speaking engagement in London.\\n\\n\"We will get through this situation together,\" Ms. Grégoire Trudeau said in a statement. \"Please share the facts and take your health seriously.\"\\n\\nMr. Trudeau\\'s possible exposure to the virus first came under scrutiny this week after health authorities said a man tested positive after attending a major mining conference early this month where the Canadian leader delivered a keynote address.\\n\\nMore than 100 Canadians have tested positive for the coronavirus and one person has died.\\n\\nRegional authorities on Thursday stepped up their containment efforts, with new measures in parts of the country including bans on large gatherings and school closures. Some provinces also advised people not to travel outside the country -- including to the U.S. -- and told those who do travel to isolate themselves for 14 days after returning to Canada.\\n\\nWrite to Kim Mackrael at kim.mackrael@wsj.com\\n\\nCopyright ©2019 Dow Jones & Company, Inc. All Rights Reserved. 87990cbe856818d5eddac44c7b1cdeb8',\n",
