       "    'body': 'The National Basketball Association season was suspended indefinitely on Wednesday night after a dramatic incident in which two teams were pulled off the court seconds before a game began and a player for the Utah Jazz tested positive for the coronavirus.\\n\\nOklahoma City Thunder and Utah Jazz players were moments from beginning their scheduled game on Wednesday when the abrupt postponement occurred after Jazz superstar Rudy Gobert tested positive for the virus. He became the first major professional athlete infected in the...',\n",
