       "    'title': 'A USS Theodore Roosevelt Crew Member With Covid-19 Is Moved to Intensive Care ',\n",
       "    'body': 'A U.S. sailor from the USS Theodore Roosevelt who had tested positive for a coronavirus infection was moved to intensive care Thursday, in the most serious case to confront sailors of the aircraft carrier. The crew member is in critical condition, Navy officials said.\\n\\nThe chief petty officer tested positive for Covid-19 on March 30, Navy officials said, and had been staying in an isolation room. During a routine welfare check, the crew member was found unresponsive....',\n",
