       "    'title': 'Acting Navy Secretary Apologizes for Berating Ousted Captain of Coronavirus-Hit USS Roosevelt ',\n",
       "    'body': \"In an about-face, acting Navy Secretary Thomas Modly apologized Monday night for his profanity-tinged remarks over the loudspeakers of the USS Theodore Roosevelt, in which he called the aircraft carrier's former commander stupid or naive for writing and distributing a memo about a coronavirus outbreak.\\n\\nThe remarks to crew members by Mr. Modly earlier Monday drew outrage from many sailors and Navy officials, calls from lawmakers for his resignation and disapproval from President Trump....\",\n",
