       "    'body': \"NEW DELHI -- India is ending a ban on the export of hydroxychloroquine, an antimalarial drug that may help treat victims of the new coronavirus. The South Asian nation's decision comes just days after President Trump urged India to release supplies of the medicine, as it is one of its biggest producers.\\n\\nIndia is one of the world's largest producers of all kinds of generic medicines and had restricted exports of several drugs last month to ensure it had enough on hand to fight coronavirus at home....\",\n",
